import {
  ChangeDetectionStrategy,
  Component,
  HostBinding,
  Input,
} from '@angular/core';

export interface Link {
  text: string;
  routerLink: any[] | string;
}

@Component({
  selector: 'app-label',
  template: `
    <p class="top">
      <a
        *ngIf="asLink(topLabel); let label; else: topText"
        [routerLink]="label.routerLink"
      >
        {{ label.text }}
      </a>
      <ng-template #topText>
        <span>{{ topLabel }}</span>
      </ng-template>
    </p>
    <p class="bottom">
      <ng-container *ngIf="asArray(bottomLabel); let labels">
        <ng-container *ngFor="let label of labels; let last = last">
          <a
            *ngIf="asLink(label); let label; else: labelText"
            [routerLink]="label.routerLink"
          >
            {{ label.text }}
          </a>
          <ng-template #labelText>
            <span>{{ label }}</span>
          </ng-template>
          <ng-container *ngIf="!last">
            <span class="separator">â€¢</span>
          </ng-container>
        </ng-container>
      </ng-container>
    </p>
  `,
  styles: [
    `
      :host {
        display: flex;
        flex-direction: column;
      }
      :host.center p {
        justify-content: center;
      }
      p {
        font-size: 16px;
        line-height: 19px;
        display: flex;
      }
      .top {
        margin-bottom: 3px;
        font-weight: 500;
      }
      .bottom {
        color: #aaa;
        font-weight: 400;
      }
      a {
        text-decoration: none;
      }
      a:hover {
        text-decoration: underline;
      }
      .separator {
        margin: 0 4px;
      }
    `,
  ],
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class LabelComponent {
  @Input() topLabel!: string | Link;
  @Input() bottomLabel!: string | Link | (string | Link)[];

  @HostBinding('class')
  @Input()
  align: 'left' | 'center' = 'left';

  asArray(val: string | Link | (string | Link)[]): (string | Link)[] {
    return Array.isArray(val) ? (val as Link[]) : [val];
  }

  asLink(val: string | Link): false | Link {
    return typeof val !== 'string' ? (val as Link) : false;
  }
}

import { ChangeDetectionStrategy, Component, Input } from '@angular/core';
import { Icons } from '../icons';

@Component({
  selector: 'app-menu',
  template: `
    <button mat-icon-button [matMenuTriggerFor]="menu">
      <app-icon [path]="triggerIcon"></app-icon>
    </button>
    <mat-menu #menu="matMenu">
      <ng-template matMenuContent>
        <button
          mat-menu-item
          *ngFor="let item of menuItems"
          (click)="item.click ? item.click() : undefined"
          [disabled]="item.disabled"
        >
          <app-icon *ngIf="item.icon" [path]="item.icon"></app-icon>
          <span>{{ item.text }}</span>
        </button>
      </ng-template>
    </mat-menu>
  `,
  styles: [
    `
      :host {
        display: block;
      }
      .mat-menu-item app-icon {
        margin-right: 16px;
      }
    `,
  ],
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class MenuComponent {
  @Input() triggerIcon = Icons.dotsVertical;
  @Input() menuItems!: MenuItem[];
  icons = Icons;
}

export interface MenuItem {
  icon?: string;
  text: string;
  disabled?: boolean;
  click?: () => void;
}

