:host {
  position: sticky;
  top: 0;
  display: flex;
  flex-direction: row;
  align-items: center;
  /*flex: 0 0 64px;*/
  padding: 8px 16px;
  box-sizing: border-box;
  width: 100%;
  white-space: nowrap;
  background: rgb(33, 33, 33);
  z-index: 100;
  font-weight: 500;
  font-size: 20px;
  transition: background-color ease 200ms;
  border-bottom: 1px solid rgba(255, 255, 255, 0.1);
}
:host-context(.scrolled-top) {
  background: transparent;
  border-bottom: none;
}
h1 {
  font-family: 'YT Sans', sans-serif;
  letter-spacing: -1px;
  font-size: 32px;
  margin-right: 16px;
  display: flex;
  align-items: center;
}
h1 span {
  display: none;
}
h1 app-icon {
  margin-right: 8px;
}
nav {
  display: flex;
  margin: 0 auto;
}
a {
  text-decoration: none;
  padding: 8px;
  margin: 0 8px;
  display: flex;
  align-items: center;
  color: rgba(255, 255, 255, 0.5);
}
a:hover,
a:active {
  color: white;
  text-decoration: none;
}
a span {
  display: none;
}
@media (min-width: 600px) {
  nav app-icon:not(.search) {
    display: none;
  }
  nav app-icon.search {
    margin-right: 8px;
  }
  a span {
    display: initial;
  }
}
@media (min-width: 755px) {
  h1 span {
    display: initial;
  }
  app-menu {
    margin-left: 155px;
  }
}

